import React from 'react'

const drumButton = ({text, audio, altAudio, volume, power, bank}) => {
  const handleClick = () => {
    console.log("press")
    console.log(volume)
    console.log(power)
    console.log(bank)
    audio.volume = volume;
    audio.play();
  }
  return (
    <div className='drumButton' onClick={handleClick}>
        {text}
    </div>
  )
}

export default drumButton
